fields.notes:
Music To Be Murdered By is [a=Eminem]'s eleventh studio album, released without prior announcement on digital platforms on January 17, 2020, with physical editions (CD) following two weeks later.
The album was issued with artwork variants, all mentioning Eminem's alter ego [a=Slim Shady]:
тАв picture of Eminem holding a shovel (digital editions);
тАв picture of Eminem, hatless, with his hands behind his back (standard CD, vinyl & cassette editions);
тАв picture of Eminem holding a gun and axe pointed to his head (limited CD, vinyl & cassette editions).

Although Slim Shady is the monicker appearing on the album artwork, alongside a stylised "Jason mask" logo, digital editions metadata credit Eminem and CD / vinyl / cassette editions list Eminem as the performer / main artist on their spines.
